    fn new<T>(text: T) -> Self
    where
        T: AsRef<str>,
    {
        let text = text.as_ref();
        if text.is_empty() {
            return Self::Empty;
        }
        {
            let len = text.len();
            if len <= INLINE_CAP {
                // Safety: we have checked the length of text <= `INLINE_CAP`.
                return unsafe { Self::new_inline_impl(text) };
            }
        }

        Self::Bytes(Bytes::copy_from_slice(text.as_bytes()))
    }
