HttpConverter.to_http_format.Content:
impl HttpConverter {
    /// Convert `RPC_PERSIST_TEST_KEY` to `rpc-persist-test-key`
    #[inline]
    /// Convert `RPC_PERSIST_TEST_KEY` to `rpc-persist-test-key`
    #[inline]
    fn to_http_format(&self, key: &str, buf: &mut String) {
        for ch in key.chars() {
            let ch = match ch {
                'A'..='Z' => ch.to_ascii_lowercase(),
                '_' => '-',
                _ => ch,
            };
            buf.push(ch);
        }
    }
}

